import React from 'react';
import styled from 'styled-components';

const Styled = styled.section`
  display: grid;
  grid-row-gap: 1em;
  background-color: var(--white-clr);
  color: var(--second-clr);
`;

const ProfileStats = () => {
  return <div></div>;
};

export default ProfileStats;
